export const PostCard = ({title, body, cover, id}) => {

    return(
        <div className="post-content">
                    <img src={post.cover} alt={post.title} />
                    <div key={post.id} className="post-card">
                      <h1>{post.title}</h1>
                      <p>{post.body}</p>
                    </div>
        </div>
    )
}
